import React from 'react';
import {Link} from 'react-router-dom'
import UploadImage from '../ImageUploadForm'
import axios from 'axios'
import time from '../../TimeFunctions'

function Timeline(){

  const [uploadimage,setUploadImage] = React.useState('');
  const [dataOnUser,setDataOnUser] = React.useState([]);
  const [userName,setUserName] = React.useState('');

  React.useEffect(()=>{
    const id = localStorage.getItem('email');
    axios.post('http://localhost:8887/home/getpost',{'email':id})
    .then(res=>{
      setDataOnUser(res.data);
      console.log(res.data);
    })
  },[])

  React.useEffect(()=>{
    const id = localStorage.getItem('email');
    axios.post('http://localhost:8887/home/userdata',{'email':id})
    .then(res=>{
      console.log(res)
      setUserName(res.data.fname+' '+res.data.lname);
    })
  },[])


}

export default Timeline;
